USE [MyDatabase]
GO

SET ANSI_NULLS ON
GO

SET QUOTED_IDENTIFIER ON
GO

IF OBJECT_ID(N'member') IS NOT NULL
    DROP TABLE member
GO

CREATE TABLE member (
    [member_code] NVARCHAR(8) NOT NULL PRIMARY KEY CLUSTERED
    ,[given_name] NVARCHAR(128) NOT NULL
    ,[family_name] NVARCHAR(128) NOT NULL
    ,[given_name_kana] NVARCHAR(128) NOT NULL
    ,[family_name_kana] NVARCHAR(128) NOT NULL
    ,[given_name_kanji] NVARCHAR(128) NOT NULL
    ,[family_name_kanji] NVARCHAR(128) NOT NULL
    ,[mail_address] NVARCHAR(256) NOT NULL
    ,[joined_date] DATE NOT NULL
    ,[termination_date] DATE NULL
    ,[department_code] NVARCHAR(6) NOT NULL
    ,[note] NVARCHAR(4000) NULL
    );
GO

ALTER TABLE member
    WITH CHECK ADD CONSTRAINT FK_member_department FOREIGN KEY (department_code) REFERENCES department(department_code)
GO

ALTER TABLE member CHECK CONSTRAINT FK_member_department
GO

